description:
Grace (2009) NTSC

Verenigde Staten / Canada
Drama / Horror
85 minuten

geregisseerd door Paul Solet
met Jordan Ladd, Gabrielle Rose en Samantha Ferris

Madeline Matheson is acht maanden zwanger. Met nog een maand te gaan, maakt Madeline een ongeluk mee. Bij dit ongeluk komt het ongeboren kind om. Madeline besluit echter de negen maanden af te ronden en het kind niet weg te laten halen. Wonderlijk genoeg brengt Madeline haar kind alsnog levend ter wereld. Maar al snel merkt ze dat er iets mis is en ze moet verschrikkelijke opofferingen maken om haar hongerige kind in leven te houden.



